var level = require('level')
var db = level('./testdb')

var keys = 1024*1024
var batches = 16
var batch_size = keys / batches

function r() {
  return Math.random().toString(15).slice(2)
}

var r = ""

for (var i = 0; i < batches; i++) {
  var batch = [];
  for (var j = 0; j < batch_size; j++) {
    batch.push({ type: 'put', key: i + '_' + j, value: r })
  }
  db.batch(batch, function() {
  })
}

